import React, { useState } from 'react';
import { 
  Card, 
  Heading, 
  Paragraph,
  Button,
  NativeSelect,
  Switch,
  Textfield
} from '@digdir/designsystemet-react';

interface ThemeColor {
  name: string;
  value: string;
}

const ThemeBuilder: React.FC = () => {
  const [darkMode, setDarkMode] = useState(false);
  const [selectedComponent, setSelectedComponent] = useState('button');
  const [colors, setColors] = useState<ThemeColor[]>([
    { name: 'primary', value: '#0067C5' },
    { name: 'secondary', value: '#66A3FF' },
    { name: 'success', value: '#006A4D' },
    { name: 'danger', value: '#C30000' }
  ]);

  const handleColorChange = (colorName: string, newValue: string) => {
    setColors(colors.map(color => 
      color.name === colorName ? { ...color, value: newValue } : color
    ));
  };

  const getColorLabel = (colorName: string) => {
    return colorName.charAt(0).toUpperCase() + colorName.slice(1);
  };

  return (
    <div>
      <Heading level={1} size="xlarge" spacing>
        Temabygger
      </Heading>
      <Paragraph spacing>
        Tilpass utseendet til Designsystemet-komponenter ved å justere farger og forhåndsvise ulike temaer.
      </Paragraph>

      <div style={{ display: 'grid', gridTemplateColumns: '300px 1fr', gap: '2rem' }}>
        <Card>
          <div style={{ padding: '1rem' }}>
            <Heading level={2} size="small" spacing>Temainnstillinger</Heading>

            <div style={{ marginBottom: '1rem' }}>
              <Switch
                checked={darkMode}
                onChange={() => setDarkMode(!darkMode)}
              >
                Mørk modus
              </Switch>
            </div>

            <div style={{ marginBottom: '1rem' }}>
              <NativeSelect 
                label="Forhåndsvis komponent"
                value={selectedComponent}
                onChange={(e) => setSelectedComponent(e.target.value)}
              >
                <option value="button">Knapp</option>
                <option value="card">Kort</option>
                <option value="input">Inndata</option>
              </NativeSelect>
            </div>

            <Heading level={3} size="xsmall" spacing>Farger</Heading>
            {colors.map(color => (
              <div key={color.name} style={{ marginBottom: '1rem' }}>
                <Textfield
                  label={getColorLabel(color.name)}
                  value={color.value}
                  onChange={(e) => handleColorChange(color.name, e.target.value)}
                />
              </div>
            ))}
          </div>
        </Card>

        <Card>
          <div style={{ padding: '1rem' }}>
            <Heading level={2} size="small" spacing>Forhåndsvisning</Heading>

            <div style={{ 
              padding: '2rem',
              background: darkMode ? '#333' : '#fff',
              borderRadius: '8px',
              transition: 'background-color 0.3s'
            }}>
              {selectedComponent === 'button' && (
                <div style={{ display: 'flex', gap: '1rem' }}>
                  <Button variant="primary">Primærknapp</Button>
                  <Button variant="secondary">Sekundærknapp</Button>
                </div>
              )}

              {selectedComponent === 'card' && (
                <Card>
                  <div style={{ padding: '1rem' }}>
                    <Heading level={3} size="small" spacing>Korttittel</Heading>
                    <Paragraph>Dette er et eksempelkort med ditt tema.</Paragraph>
                  </div>
                </Card>
              )}

              {selectedComponent === 'input' && (
                <div style={{ display: 'flex', flexDirection: 'column', gap: '1rem' }}>
                  <Textfield label="Eksempelinndata" placeholder="Skriv tekst..." />
                  <Switch>Vekslebryter</Switch>
                </div>
              )}
            </div>
          </div>
        </Card>
      </div>
    </div>
  );
};

export default ThemeBuilder;
